describe('what Demo.Helpers can do', function() {
    it('adds items to an array', function() {
        var arr = [4];
        Demo.Helpers.addRange(arr, [1, 2, 4, 5]);
        expect(arr).toEqual([4, 1, 2, 4, 5]);
    });
    it('gets a page of items from an array', function() {
        var arr = [4, 1, 2, 4, 5, 2];
        var page = Demo.Helpers.getPage(arr, 2, 2);
        expect(page).toEqual([2, 4]);
    });
    
    it('returns no items when the request is out of bounds', function () {
        var arr = [4, 1, 2, 4, 5, 2];
        var page = Demo.Helpers.getPage(arr, 2, 10);
        expect(page).toEqual([]);
    });
});

